"use strict";
class Entity {
    constructor(position, size, velocityX, velocityY, direction, image) {
        this.isRemoved = false;
        this.isSoundPlaying = false;
        this.position = createVector(position.x, position.y);
        this.size = createVector(size.x, size.y);
        this.velocity = createVector(velocityX, velocityY);
        this.direction = createVector(direction.x, direction.y);
        this.image = image;
    }
    draw() {
        if (this.isRemoved)
            return;
        push();
        if (this.image) {
            image(this.image, this.position.x, this.position.y, this.size.x, this.size.y);
        }
        pop();
    }
    update() {
        if (this.isRemoved)
            return;
    }
}
class Block extends Entity {
    constructor(x, y) {
        super(createVector(x, y), createVector(32, 32), 0, 0, createVector(0, 0), images.wallBlock);
    }
    draw() {
        push();
        imageMode(CENTER);
        translate(this.position.x, this.position.y);
        noStroke();
        rectMode(CENTER);
        rect(0, 0, this.size.x, this.size.y);
        if (this.image) {
            image(this.image, 0, 0, this.size.x, this.size.y);
        }
        else {
            console.warn("Wallblock entity has no image to draw.");
        }
        pop();
    }
}
class Button {
    constructor(text, position, backgroundColor, size, color) {
        this.text = text;
        this.position = position;
        this.backgroundColor = backgroundColor;
        this.size = size;
        this.color = color;
    }
    draw() {
        push();
        fill(this.backgroundColor);
        rectMode(CENTER);
        rect(this.position.x, this.position.y, this.size.x, this.size.y);
        fill(this.color);
        textAlign(CENTER, CENTER);
        text(this.text, this.position.x, this.position.y);
        pop();
    }
    isClicked() {
        return (mouseIsPressed &&
            mouseX > this.position.x - this.size.x / 2 &&
            mouseX < this.position.x + this.size.x / 2 &&
            mouseY > this.position.y - this.size.y / 2 &&
            mouseY < this.position.y + this.size.y / 2);
    }
}
class CollisionManager {
    constructor(players, entities, scoreManager, removeEntityCallback) {
        this.players = players;
        this.entities = entities;
        this.scoreManager = scoreManager;
        this.removeEntityCallback = removeEntityCallback;
    }
    handleTetrisCollision(player) {
        sounds.blockCollision.play();
        if (music.backgroundMusic.isPlaying()) {
            music.backgroundMusic.stop();
        }
        player.isColliding = true;
        player.isMoving = false;
        console.log(`Player ${player.playerNumber} collided with a TetrisBlock.`);
        this.showGameOver(player.playerNumber);
    }
    handleBlockCollision(player) {
        sounds.wallCollision.play();
        if (music.backgroundMusic.isPlaying()) {
            music.backgroundMusic.stop();
        }
        player.isColliding = true;
        player.isMoving = false;
        console.log(`Player ${player.playerNumber} collided with a TetrisBlock.`);
        this.showGameOver(player.playerNumber);
    }
    handleWinBlockCollision(player) {
        sounds.goalline.play();
        if (music.backgroundMusic.isPlaying()) {
            music.backgroundMusic.stop();
        }
        player.isColliding = true;
        player.isMoving = false;
        console.log(`Player ${player.playerNumber} won!`);
        const otherPlayerNumber = player.playerNumber === 1 ? 2 : 1;
        this.showGameOver(otherPlayerNumber);
    }
    handleStarCollision(player, star) {
        if (star.isRemoved)
            return;
        sounds.starPickUp.play();
        player.isColliding = true;
        player.scoreMultiplier = 2;
        const scoreInterval = setInterval(() => {
            this.scoreManager.updateScore(player.getPlayerNumber(), 50 * player.scoreMultiplier);
        }, 1000);
        setTimeout(() => {
            player.scoreMultiplier = 1;
            clearInterval(scoreInterval);
            console.log(`Player ${player.playerNumber}'s score multiplier reset.`);
        }, 10000);
        star.isRemoved = true;
        this.removeEntityCallback(star);
        console.log(`Star entity removed:`, star);
    }
    handleHeartCollision(player, heart) {
        if (heart.isRemoved)
            return;
        sounds.gainheart.play();
        player.isColliding = true;
        console.log(`Player ${player.playerNumber} collected a Heart!`);
        if (player.lives < player.maxLives) {
            player.lives += 1;
        }
        heart.isRemoved = true;
        this.removeEntityCallback(heart);
        console.log(`Heart entity removed:`, heart);
    }
    handlePlantCollision(player) {
        const currentTime = Date.now();
        if (currentTime - player.lastCollisionTime < player.collisionCooldown) {
            return;
        }
        player.lastCollisionTime = currentTime;
        console.log(`Player lives before collision: ${player.lives}`);
        sounds.blockCollision.play();
        player.isColliding = true;
        player.lives -= 2;
        console.log(`Player lives after collision: ${player.lives}`);
        if (player.lives < 0) {
            player.lives = 0;
        }
        if (player.lives <= 0) {
            if (music.backgroundMusic.isPlaying()) {
                music.backgroundMusic.stop();
            }
            this.showGameOver(player.playerNumber);
        }
    }
    handleGhostProximity(player, ghost) {
        const distance = dist(player.trail[0].x, player.trail[0].y, ghost.position.x, ghost.position.y);
        if (distance < 200) {
            console.log("Ghost is near, playing sound...");
            if (!ghost.isSoundPlaying) {
                sounds.ghost.play();
                ghost.isSoundPlaying = true;
                console.log("Ghost sound started");
            }
            else {
                if (ghost.isSoundPlaying) {
                    sounds.ghost.stop();
                    ghost.isSoundPlaying = false;
                    console.log("Ghost sound stopped");
                }
            }
        }
    }
    handleGhostCollision(player) {
        const currentTime = Date.now();
        if (currentTime - player.lastCollisionTime > 2000) {
            player.isColliding = true;
            player.lives -= 1;
            if (player.lives < 0) {
                player.lives = 0;
            }
            if (player.lives === 0) {
                this.showGameOver(player.playerNumber);
            }
            this.scoreManager.updateScore(player.getPlayerNumber(), -5);
            player.lastCollisionTime = currentTime;
        }
    }
    checkCollision() {
        for (const player of this.players) {
            const head = player.trail[0];
            const headLeft = head.x;
            const headRight = head.x + player.size.x;
            const headTop = head.y;
            const headBottom = head.y + player.size.y;
            let hasCollision = false;
            for (const entity of this.entities) {
                if (entity instanceof Ghost) {
                    this.handleGhostProximity(player, entity);
                }
                const entityLeft = entity.position.x;
                const entityRight = entity.position.x + entity.size.x;
                const entityTop = entity.position.y;
                const entityBottom = entity.position.y + entity.size.y;
                const isColliding = headRight > entityLeft &&
                    headLeft < entityRight &&
                    headBottom > entityTop &&
                    headTop < entityBottom;
                if (isColliding) {
                    hasCollision = true;
                    if (!player.isColliding) {
                        if (entity instanceof TetrisBlock) {
                            this.handleTetrisCollision(player);
                        }
                        else if (entity instanceof Block) {
                            this.handleBlockCollision(player);
                        }
                        else if (entity instanceof Star) {
                            this.handleStarCollision(player, entity);
                        }
                        else if (entity instanceof Heart) {
                            this.handleHeartCollision(player, entity);
                        }
                        else if (entity instanceof Plant) {
                            this.handlePlantCollision(player);
                        }
                        else if (entity instanceof Ghost) {
                            this.handleGhostCollision(player);
                        }
                        else if (entity instanceof WinBlock) {
                            this.handleWinBlockCollision(player);
                        }
                        break;
                    }
                }
                if (!hasCollision) {
                    player.isColliding = false;
                }
            }
        }
    }
    showGameOver(losingPlayer) {
        const winnerMessage = losingPlayer === 1
            ? " - Player 2"
            : losingPlayer === 2
                ? " - Player 1"
                : "Game Over!";
        game.changeScreen(new GameOverScreen(winnerMessage, this.scoreManager));
        console.log(winnerMessage);
    }
    showPopupMessage(message, duration = 3000) {
        const popup = document.createElement("div");
        popup.innerText = message;
        popup.style.position = "absolute";
        popup.style.top = "10px";
        popup.style.left = "50%";
        popup.style.transform = "translateX(-50%)";
        popup.style.backgroundColor = "rgba(0, 0, 0, 0.8)";
        popup.style.color = "white";
        popup.style.padding = "10px 20px";
        popup.style.borderRadius = "8px";
        popup.style.zIndex = "1000";
        document.body.appendChild(popup);
        setTimeout(() => {
            document.body.removeChild(popup);
        }, duration);
    }
}
class GameScreen {
    constructor() { }
}
class CountDown extends GameScreen {
    constructor(level, callback) {
        super();
        this.countdownDuration = 3;
        this.countdownValue = this.countdownDuration;
        this.lastUpdateTime = Date.now();
        this.isComplete = false;
        this.callback = callback;
        this.level = level;
    }
    update() {
        const currentTime = Date.now();
        const deltaTime = (currentTime - this.lastUpdateTime) / 1000;
        if (this.countdownValue > 0) {
            this.countdownValue -= deltaTime;
            if (this.countdownValue <= 0) {
                this.countdownValue = 0;
                this.isComplete = true;
                this.callback();
                game.changeScreen(new GameBoard(this.level));
            }
        }
        this.lastUpdateTime = currentTime;
    }
    draw() {
        push();
        background("black");
        fill("#45FF8C");
        textSize(32);
        textAlign(CENTER, CENTER);
        textFont(customFont);
        text("GET READY", width / 2, height / 4);
        fill("#FFFFFF");
        textSize(84);
        const displayNumber = Math.ceil(this.countdownValue);
        if (displayNumber > 0) {
            text(displayNumber.toString(), width / 2, height / 3);
        }
        pop();
    }
    isCountdownComplete() {
        return this.isComplete;
    }
}
class Game {
    constructor() {
        this.activeScreen = [
            new StartMenu(new Button("Start Game", createVector(width / 2, height / 2 + 125), "#515151", createVector(350, 50), "#45FF8C")),
        ];
    }
    changeScreen(newScreen) {
        this.activeScreen = [newScreen];
    }
    newGame() {
        const defaultLevel = [[1]];
        this.changeScreen(new GameBoard(defaultLevel));
    }
    update() {
        for (const screen of this.activeScreen) {
            screen.update();
        }
    }
    draw() {
        for (const screen of this.activeScreen) {
            screen.draw();
        }
    }
    end() { }
}
class StartMenu extends GameScreen {
    constructor(button) {
        super();
        this.selectedButton = null;
        this.selectedDifficulty = null;
        this.startGameButton = button;
        this.selectEasyMode = new Button("Easy", createVector(width / 2, height / 2 - 125), "#515151", createVector(220, 50), "#45FF8C");
        this.selectMediumMode = new Button("Medium", createVector(width / 2, height / 2 - 50), "#515151", createVector(220, 50), "#FDD03C");
        this.selectHardMode = new Button("Hard", createVector(width / 2, height / 2 + 25), "#515151", createVector(220, 50), "#FF5F62");
        this.interactionScreen = new Button("How to play", createVector(width / 2, height - 100), "#515151", createVector(380, 50), "#FFFFFF");
        this.levelFactory = new LevelFactory();
    }
    update() {
        if (this.startGameButton.isClicked()) {
            let selectedLevel;
            switch (this.selectedDifficulty || "easy") {
                case "easy":
                    selectedLevel = this.levelFactory.level1;
                    break;
                case "medium":
                    selectedLevel = this.levelFactory.level2;
                    break;
                case "hard":
                    selectedLevel = this.levelFactory.level3;
                    break;
                default:
                    selectedLevel = this.levelFactory.level1;
            }
            userStartAudio();
            if (!music.backgroundMusic.isPlaying()) {
                music.backgroundMusic.loop();
            }
            game.changeScreen(new CountDown(selectedLevel, () => {
                game.changeScreen(new GameBoard(selectedLevel));
            }));
        }
        if (this.selectEasyMode.isClicked()) {
            console.log("Easy mode selected");
            this.selectedButton = this.selectEasyMode;
            this.selectedDifficulty = "easy";
        }
        if (this.selectMediumMode.isClicked()) {
            console.log("Medium mode selected");
            this.selectedButton = this.selectMediumMode;
            this.selectedDifficulty = "medium";
        }
        if (this.selectHardMode.isClicked()) {
            console.log("Hard mode selected");
            this.selectedButton = this.selectHardMode;
            this.selectedDifficulty = "hard";
        }
        if (this.interactionScreen.isClicked()) {
            console.log("Interaction selected");
            game.changeScreen(new InteractionScreen());
        }
    }
    draw() {
        background("black");
        push();
        fill("#45FF8C");
        textAlign(CENTER, CENTER);
        textFont(customFont);
        textSize(42);
        text("Furious Snake", width / 2, height / 4 - 100);
        this.selectEasyMode.backgroundColor =
            this.selectedButton === this.selectEasyMode ? "white" : "#515151";
        this.selectMediumMode.backgroundColor =
            this.selectedButton === this.selectMediumMode ? "white" : "#515151";
        this.selectHardMode.backgroundColor =
            this.selectedButton === this.selectHardMode ? "white" : "#515151";
        fill("#45FF8C");
        textSize(32);
        text("SELECT DIFFICULTY", width / 2, height / 4);
        this.startGameButton.draw();
        this.selectEasyMode.draw();
        this.selectMediumMode.draw();
        this.selectHardMode.draw();
        this.interactionScreen.draw();
        pop();
    }
    newGame() {
        console.log("Starting a new game...");
        game.changeScreen(new StartMenu(this.startGameButton));
    }
}
class ScoreManager {
    constructor(players) {
        this.scoreIncrementInterval = 500;
        this.lastTickTime = 0;
        this.scores = new Map();
        this.players = players;
        for (const player of players) {
            this.scores.set(player.getPlayerNumber(), 0);
        }
        this.lastTickTime = millis();
    }
    updateScore(playerNumber, points) {
        if (this.scores.has(playerNumber)) {
            const currentScore = this.scores.get(playerNumber) || 0;
            this.scores.set(playerNumber, currentScore + points);
            console.log(`Player ${playerNumber}'s score updated: ${this.scores.get(playerNumber)}`);
        }
    }
    tickScore() {
        const currentTime = millis();
        if (currentTime - this.lastTickTime >= this.scoreIncrementInterval) {
            for (const [playerNumber] of this.scores.entries()) {
                this.updateScore(playerNumber, 1);
            }
            this.lastTickTime = currentTime;
        }
    }
    draw() {
        push();
        textSize(24);
        fill("white");
        textAlign(CENTER, CENTER);
        for (const [playerNumber, score] of this.scores.entries()) {
            const player = this.players.find((p) => p.getPlayerNumber() === playerNumber);
            if (player) {
                const textContent = `Player: ${playerNumber} Score: ${score} | Lives: ${player.lives}`;
                if (playerNumber === 1) {
                    text(textContent, width / 2, 50);
                }
                else if (playerNumber === 2) {
                    text(textContent, width / 2, height - 40);
                }
            }
        }
        pop();
    }
    getScore(playerNumber) {
        return this.scores.get(playerNumber) || 0;
    }
}
class Player extends Entity {
    getPlayerNumber() {
        return this.playerNumber;
    }
    constructor(position, playerNumber, trailFillColor, trailStrokeColor, keyBindings) {
        const size = createVector(32, 32);
        position.x = position.x + 16;
        position.y = position.y + 16;
        super(position, size, 0, 0, createVector(0, 500), undefined);
        this.isColliding = false;
        this.trail = [
            createVector(this.position.x - size.x, this.position.y),
            createVector(this.position.x - size.x * 2, this.position.y),
            createVector(this.position.x - size.x * 3, this.position.y),
            createVector(this.position.x - size.x * 4, this.position.y),
            createVector(this.position.x - size.x * 5, this.position.y),
            createVector(this.position.x - size.x * 6, this.position.y),
            createVector(this.position.x - size.x * 7, this.position.y),
            createVector(this.position.x - size.x * 8, this.position.y),
        ];
        this.playerNumber = playerNumber;
        this.trailFillColor = trailFillColor;
        this.trailStrokeColor = trailStrokeColor;
        this.moveTimer = 0;
        this.direction = createVector(32, 0);
        this.nextDirection = this.direction.copy();
        this.keyBindings = keyBindings;
        this.isMoving = true;
        this.lives = 3;
        this.maxLives = 10;
        this.lastCollisionTime = 0;
        this.collisionCooldown = 1000;
        this.scoreMultiplier = 1;
        this.canPassThroughObstacles = false;
    }
    handleInput() {
        if (keyIsDown(this.keyBindings.UP) && this.direction.y === 0) {
            this.nextDirection = createVector(0, -32);
        }
        else if (keyIsDown(this.keyBindings.DOWN) && this.direction.y === 0) {
            this.nextDirection = createVector(0, 32);
        }
        else if (keyIsDown(this.keyBindings.LEFT) && this.direction.x === 0) {
            this.nextDirection = createVector(-32, 0);
        }
        else if (keyIsDown(this.keyBindings.RIGHT) && this.direction.x === 0) {
            this.nextDirection = createVector(32, 0);
        }
    }
    update() {
        if (!this.isMoving) {
            return;
        }
        this.moveTimer += deltaTime;
        if (this.moveTimer >= 200) {
            this.moveTimer = -100;
            this.direction = this.nextDirection.copy();
            const head = this.trail[0];
            const newHead = createVector(head.x + this.direction.x, head.y + this.direction.y);
            this.trail.unshift(newHead);
            this.trail.pop();
        }
        this.handleInput();
    }
    draw() {
        push();
        strokeWeight(0);
        for (let i = 0; i < this.trail.length; i++) {
            const position = this.trail[i];
            let diameter = Math.max(this.size.x, this.size.y);
            drawingContext.shadowBlur = 15;
            drawingContext.shadowColor = "rgba(0, 0, 0, 0.3)";
            drawingContext.shadowOffsetX = 5;
            drawingContext.shadowOffsetY = 5;
            let ctx = drawingContext;
            let gradient = ctx.createRadialGradient(position.x - diameter * 0.3, position.y - diameter * 0.3, diameter * 0.1, position.x, position.y, diameter * 0.8);
            if (i === 0) {
                gradient.addColorStop(0, "#FFE5CC");
                gradient.addColorStop(0.3, "#FFA500");
                gradient.addColorStop(1, "#804600");
            }
            else {
                gradient.addColorStop(0, lerpColor(color(this.trailFillColor), color("#ffffff"), 0.2).toString());
                gradient.addColorStop(0.3, this.trailFillColor);
                gradient.addColorStop(1, lerpColor(color(this.trailStrokeColor), color(0), 0.7).toString());
            }
            ctx.fillStyle = gradient;
            noStroke();
            ellipse(position.x, position.y, diameter, diameter);
            drawingContext.shadowBlur = 0;
            drawingContext.shadowOffsetX = 0;
            drawingContext.shadowOffsetY = 0;
        }
        pop();
    }
    addScore(points) {
        const totalPoints = points * this.scoreMultiplier;
        console.log(`Player ${this.playerNumber} gained ${totalPoints} points!`);
    }
    enableObstaclePassing(duration) {
        this.canPassThroughObstacles = true;
        console.log(`Player ${this.playerNumber} can now pass through obstacles`);
        setTimeout(() => {
            this.canPassThroughObstacles = false;
            console.log(`Player ${this.playerNumber} can no longer pass through obstacles`);
        }, duration);
    }
    doubleLives() {
        this.lives = Math.min(this.lives * 2, this.maxLives);
        console.log(`Player ${this.playerNumber} now has ${this.lives} lives.`);
    }
}
